import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Row, Col, FormGroup, Label, Input , UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem , Button} from "reactstrap";

class App extends React.Component{
  render() {
    return (
      <div className="App">
        <header>
          <h2>User Profile</h2>
        </header>
        <body>
          <Row className = "formRow">
            <Col>
              <label>Location : </label>
            </Col>
            <Col>
              <label></label>
            </Col>
          </Row>

          <Row className = "formRow">
          <label>Email : </label>
          <label></label>
          </Row>

          <Row className = "formRow">
          <label>Bio : </label>
          <label></label>
          </Row>

          <Row className = "formRow">
          <label>Profile link : </label>
          <label></label>
          </Row>

          <Row className = "formRow">
          <label>Total Number of Starred Repo's : </label>
          <label></label>
          </Row>

          <Row className = "formRow">
          <label>Followers</label>
          <label></label>
          </Row>

        </body>
      </div>
    );
  }
}
